import React from 'react';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const ImageCard = props => {
  const {
    fixed_width: { url }
  } = props.image;
  return (
    <Grid container spacing={4}>
      <Grid item xs>
        <Paper>
          <img src={url} alt={props.alt} />
        </Paper>
      </Grid>
    </Grid>
  );
};

export default ImageCard;
